import styled from 'styled-components'
import CourseMap from './CourseMap'
import Footer from './footer'

const Dashboard = () => {
  return (

    <Container> 
      <Hello> HELLO. </Hello>
      <Line />


      <Ellipse> </Ellipse>

  </Container> 

  )
}

export default Dashboard

const Container = styled.div`
  min-width: 100%;
  min-height: 100%;
  background-color: #DCDCDC;
  justify-content: space-evenly;
`

const Hello = styled.h2`
position: absolute;
width: 446px;
height: 126px;
left: 200px;
top: 50px;
font-family: 'Helvetica Neue';
font-style: normal;
font-weight: 700;
font-size: 140px;
line-height: 110px;
color: #1F1D1D;
`
const Box = styled.div`
absolute;
width: 607.66px;
height: 742.93px;
margin-top: 20%;

background: #1F1D1D;
transform: rotate(0deg);
`

const Ellipse = styled.div `
position: absolute;
width: 1200px;
height: 1200px;
left: 2600px;
top: 500px;
border-radius: 50%;

background: #1F1D1D;
`

const Line = styled.div`
width: 0px;
height: 4000px;
margin-top:8%;
margin-left:7.95%;

border: 11.99999px solid #1F1D1D;
`

const Name = styled.h2`
position: absolute;
height: 27px;
margin-left: 10%;
margin-top: 10%;
font-family: 'Helvetica';
font-style: normal;
font-weight: 400;
font-size: 30px;
line-height: 34px;
color: #DCDCDC;
`

const Text2 = styled.p`
color: #DCDCDC;
line-height: 24px;
font-size: 20px;
width: 500px;
margin-top: 100 px;
color: #1F1D1D;
padding: 30px;
font-weight: 800;
`
const Text = styled.h2`
  color: #DCDCDC;
  line-height: 24px;
  font-size: 100px;
  padding: 30px;
`
